import React, { useEffect, useState } from "react";
import axios from "../utils/axiosInstance";

const HistoryList = () => {
  const [history, setHistory] = useState([]);

  useEffect(() => {
    const fetchHistory = async () => {
      try {
        const res = await axios.get("/gdpr/history");
        setHistory(res.data);
      } catch (err) {
        console.error("Kunne ikke hente historik", err);
      }
    };
    fetchHistory();
  }, []);

  if (history.length === 0)
    return <p style={{ marginTop: "2rem" }}>Ingen tidligere analyser endnu.</p>;

  return (
    <div className="history-grid">
      {history.map((entry) => (
        <div key={entry.id} className="analysis-card">
          <p className="timestamp">
            {new Date(entry.created_at).toLocaleString("da-DK")}
          </p>
          <h4>{entry.url}</h4>
          <p>
            <strong>Score:</strong> {entry.score}%{" "}
            <span
              style={{
                marginLeft: "8px",
                padding: "2px 8px",
                borderRadius: "12px",
                backgroundColor:
                  entry.score >= 90
                    ? "#4caf50"
                    : entry.score >= 70
                    ? "#ff9800"
                    : "#f44336",
                color: "#fff",
                fontSize: "0.75rem",
              }}
            >
              {entry.score >= 90
                ? "God"
                : entry.score >= 70
                ? "OK"
                : "Lav"}
            </span>
          </p>
          <p>
            <strong>Mangler:</strong>{" "}
            {entry.missing?.length > 0 ? entry.missing.join(", ") : "Ingen"}
          </p>
          <p>
            <strong>Forslag:</strong>
          </p>
          <ul>
            {entry.suggestions?.map((s, i) => (
              <li key={i}>{s}</li>
            ))}
          </ul>
        </div>
      ))}
    </div>
  );
};

export default HistoryList;
